サスペンション機構の中で見落としがちなタイロッドですが、走行中は想像を絶する高負荷に曝されています。特に、ローダウンによって極端なロッド角度に達した状態では激しいステアリング操作に耐えきれず、緩い弓なりの歪みを繰り返しています。スーパーハードタイロッドは強度に優れた特殊鋼材を使用し、耐せん断性・耐曲がり強度を純正比約5倍に高めたスポーツ走行専用のタイロッドです。 <br><br>タイロッド径のアップを図ることにより、抜群のせん断強度と曲がり強度、驚異の耐久性を備えたスーパーハードタイロッドはハイグリップタイヤ装着により増大したステアリング機構への入力を受け止め、縁石カット等の過激な走行にも余裕で対応します。<br><br>●保安基準適合品 ●ダストブーツ標準装備 ●新開発ボールジョイント採用 ●完全ボルトオン設計 ●ロッド最小径：φ12.0（ノーマルはφ9.5） ●ロッド最大径：φ17.0（ノーマルはφ15.0） ●当製品を装着することによりトレッド幅が変化しますのでホイールオフセットにご注意下さい。 <br><br>対応車種：CN9A ランサーEVO4 <br><br>　車検対応品<br><br>足回り/足回りその他<tr><td colspan="2">
