ハイキャスリジットにジオメトリー補正機能をプラス！日産独自のリアトーコントロールシステム、スーパーハイキャス。標準車高では優れたコーナリング性能を発揮する画期的なシステムもローダウンによって狂ったジオメトリーではむしろ逆効果です。“ハイキャスリジットフレーム”は不必要なハイキャスユニットを取り外し、リジット化することで意に反するトー制御を無効にします。 <br><br>さらに、トーコントロールロッドの支点を移動することでジオメトリーを補正し、理想的なトーコントロールを実現しました。バー本体は、軽量・高剛性を誇るジュラルミン合金をフレーム形状に削り出し、メンバー補強効果も兼ね備えます。“ハイキャスリジットフレーム”を装着することで驚異的なトラクション性能が得られ、異次元のコーナリングフォースを体感することでしょう。<br><br>●保安基準適合品 ●ジュラルミン合金製 <br><br>対応車種：ER34 スカイライン <br><br>　車検対応品<br><br>足回り/足回りその他<tr><td colspan="2">
